(4, 4, 2, '<figure class=\"image\"><img src=\"https://boti.education/p/demo/assets/schools/demo/editor/0ac988d1c6f860d7efd23d8f3cfd52bfb06a4f0f.png\"></figure><h2>Ils sont Marocains et présents dans plusieurs domaines. Des personnalités, très dynamiques et célèbres, ont marqué le monde de leur empreinte et font la fierté de leur pays d’origine. Du politique jusqu’au monde de l’art, en voici quelques-uns.</h2>', NULL, NULL, 4, 1, NULL),
(7, 5, 2, '<h2><strong>Observe l’illustration et décris ce que tu vois&nbsp;?</strong></h2>', NULL, NULL, 5, 1, NULL),
