(30, 10, 2, '<h2><strong>Escalader</strong>&nbsp;: monter, gravir</h2>', NULL, NULL, 5, 1, NULL),
(31, 10, 2, '<h2><strong>Evoquer</strong>&nbsp;: citer, mentionner.</h2>', NULL, NULL, 5, 1, NULL),
(33, 4, 2, '<figure class=\"table\"><table><tbody><tr><td><h4><strong>Maire de Rotterdam, depuis 2009, Ahmed Aboutaleb, originaire du Rif marocain, a rejoint son père à La Haye, à l’âge de 15 ans.&nbsp;</strong></h4><h4>&nbsp;</h4><h4><strong>Celui-ci travaillait comme agent d’entretien.</strong></h4></td><td><figure class=\"image\"><img src=\"https://boti.education/p/demo/assets/schools/demo/editor/2da8276553f3446f4714ec4ca82155e0121d9165.png\"></figure></td></tr></tbody></table></figure><h3>&nbsp;</h3>', NULL, NULL, 3, 1, NULL),
(35, 6, 2, '<h2>Je réponds aux questions&nbsp;</h2><h2>&nbsp;</h2><h2><strong>1- &nbsp;Le texte est :</strong></h2><h2>&nbsp;</h2><h2>a- Un extrait d’un roman</h2><h2>b- Un article de journal&nbsp; &nbsp; &nbsp;&nbsp;</h2><h2>c- Un conte</h2>', NULL, NULL, 5, 1, NULL),
(37, 6, 2, '<h2><strong>2- L’auteur raconte une histoire ou communique des informations&nbsp;?</strong></h2>', NULL, NULL, 5, 1, NULL),
(38, 6, 2, '<h2><strong>3- Réponds par vrai ou faux&nbsp;:</strong></h2><h3>&nbsp;</h3><h3><strong>a- Ces célébrités sont toutes des artistes.</strong></h3><p>&nbsp;</p><h3><strong>b- Toutes ces personnalités sont nées au Maroc</strong></h3>', NULL, NULL, 5, 1, NULL),
(41, 6, 2, '<h2><strong>4- Remplis le tableau à partir du texte&nbsp;</strong></h2>', NULL, NULL, 5, 1, NULL),
(42, 6, 2, '<figure class=\"table\"><table><tbody><tr><td><h4><strong>Marocain célèbre&nbsp;</strong></h4></td><td><h4>Lieu de naissance&nbsp;</h4></td><td><h4>Pays ou ville de résidence&nbsp;</h4></td><td><h4>Profession&nbsp;</h4></td></tr><tr><td><h4>Ahmed Aboutaleb&nbsp;</h4></td><td><h4>&nbsp; ………………………………</h4></td><td><h4>&nbsp; &nbsp; &nbsp;…………………………………</h4></td><td><h4>&nbsp; &nbsp;…………………………………………..</h4></td></tr><tr><td><h4>&nbsp; &nbsp; …………………………..</h4></td><td><h4>&nbsp; …<strong>…</strong>……………………….</h4></td><td><h4>&nbsp; &nbsp; ………………………………….</h4></td><td><h4>Ministère de l’éducation nationale&nbsp;</h4></td></tr><tr><td><h4>&nbsp; &nbsp; &nbsp;…………………………</h4></td><td><h4>&nbsp; ………………………….….</h4></td><td><h4>New-York</h4></td><td><h4>&nbsp; &nbsp; &nbsp; &nbsp; ..…………………………………………</h4></td></tr><tr><td><h4>&nbsp; &nbsp; ………………………..</h4></td><td><h4>Casablanca&nbsp;</h4></td><td><h4>&nbsp; &nbsp; &nbsp;……………………………….</h4></td><td><h4>&nbsp; &nbsp; &nbsp; ………………………………………………</h4></td></tr></tbody></table></figure>', NULL, NULL, 5, 1, NULL),
(46, 6, 2, '<h2><strong>5- Quels sont les domaines de profession cités dans le texte&nbsp;?</strong></h2>', NULL, NULL, 5, 1, NULL),
(47, 6, 2, '<h2>6- Ces célébrités ont passé leurs enfances au Maroc. Qu’est ce qui le montre&nbsp;?</h2>', NULL, NULL, 5, 1, NULL),
(49, 6, 2, '<h2>7- Que peut-on dire sur leurs relations avec leur pays natal&nbsp;?&nbsp;</h2>', NULL, NULL, 5, 1, NULL),
(50, 6, 2, '<h2>8- Connais-tu d’autres célébrités marocaines dans d’autres domaines&nbsp;?</h2>', NULL, NULL, 5, 1, NULL),
(53, 4, 2, '<figure class=\"table\"><table><tbody><tr><td><h4>Des confins du Rif marocain, <strong>Najat Vallaud-Belkacem </strong>a réussi à escalader les échelons, pour devenir la première femme à accéder au poste de Ministre de l’Education nationale, de l’enseignement supérieur et de la recherche, en France.</h4></td><td><figure class=\"image\"><img src=\"https://boti.education/p/demo/assets/schools/demo/editor/7893c18a427a900b885ed941239baa45975c32ba.png\"></figure></td></tr></tbody></table></figure>', NULL, NULL, 2, 1, NULL),
(54, 4, 2, '<figure class=\"table\"><table><tbody><tr><td><h4>Dans le monde de l’art, on retrouve une célèbre figure marocaine qui a creusé son chemin parmi les grands noms de la chanson anglo-saxonne. <strong>RedOne</strong>, originaire de la ville de Tétouan, a travaillé avec des célébrités internationales comme Michael Jackson et Lady Gaga.</h4></td><td><figure class=\"image\"><img src=\"https://boti.education/p/demo/assets/schools/demo/editor/7bee11edc183d68882d90a316b4b13ac4702e90c.png\"></figure></td></tr></tbody></table></figure>', NULL, NULL, 2, 1, NULL),
(55, 4, 2, '<figure class=\"table\"><table><tbody><tr><td><h4>Parler des célébrités musicales sans évoquer<strong> French Montana</strong>, serait une erreur. Karim Kharbouch, un des grands rappeurs américains, a vu le jour à Casablanca, avant de s’installer à New-York, à l’âge de 13 ans.</h4></td><td><figure class=\"image\"><img src=\"https://boti.education/p/demo/assets/schools/demo/editor/9e8d3f49b79a483f6e007814cdcd9f34af458c79.png\"></figure></td></tr></tbody></table></figure>', NULL, NULL, 2, 1, NULL),
(56, 4, 2, '<figure class=\"table\"><table><tbody><tr><td><h4>Quand on parle d’humour, les premiers noms qui surgissent sont ceux de <strong>Jamel Debbouze </strong>et de <strong>Gad El Maleh</strong>. À l’origine du \"Jamel comedy club\" et du \"Marrakech du Rire\", Debbouze a fait ses premiers pas dans le cinéma à l’âge de 17 ans, avec le court métrage de Nabil Ayouch.&nbsp;</h4><h4>Né en 1971, à Casablanca, le \"chouchou\" des français, Gad El Maleh, a joué au Maroc, au Canada, en France et aux États-Unis.</h4><p>&nbsp;</p><p><a href=\"https://www.bladi.net/\">https://www.bladi.net/</a>&nbsp; &nbsp; &nbsp;15 août 2019 &nbsp; par K.B.</p></td><td><figure class=\"image\"><img src=\"https://boti.education/p/demo/assets/schools/demo/editor/9d91d8a0608c4dd035560316e4aefaeadb3cd52e.png\"></figure></td></tr></tbody></table></figure>', NULL, NULL, 3, 1, NULL),
(57, 1, 7, '[{\"content\":\"<p>test</p>\"}]', NULL, NULL, 5, 1, NULL),
(58, 1, 7, '[{\"content\":\"<p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Eaque provident rerum libero molestias porro necessitatibus est, quas quos doloremque voluptas sapiente repudiandae, dolore saepe aut consequuntur asperiores quae. Vero, eaque.</p><figure class=\\\"image\\\"><img src=\\\"https://boti.education/p/demo/assets/schools/demo/editor/db68033d67fa1186e01ac9dced3e4fb38654ed42.png\\\"></figure>\"},{\"content\":\"<p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Eaque provident rerum libero molestias porro necessitatibus est, quas quos doloremque voluptas sapiente repudiandae, dolore saepe aut consequuntur asperiores quae. Vero, eaque.</p>\"}]', NULL, NULL, 5, 1, NULL);
